import React from 'react';
import {View, Text, Button} from "react-native";

const Test = ({route, navigation}) => {
    return (
        <View>
            <Text>Test 1</Text>
            <Button
                title="Powrot do Home"
                onPress={() => navigation.goBack()}
            />
            <Button
                title="About Us"
                onPress={() => navigation.push("AboutUsScreen")}
                style={styles.btn}
            />
            <Button
                title="Test"
                onPress={() => navigation.push("HomeScreen")}
            />
        </View>
    );
};

export default Test;
